import React, {Component } from "react";
import Button from "@material-ui/core/Button";
import CssBaseline from "@material-ui/core/CssBaseline";
import TextField from "@material-ui/core/TextField";
import Link from "@material-ui/core/Link";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import { Redirect } from "react-router-dom";
import Container from "@material-ui/core/Container";

import { makeStyles } from '@material-ui/core/styles';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import EmailIcon from '@material-ui/icons/Email';
import ContactSupportIcon from '@material-ui/icons/ContactSupport';

import AccountCircle from '@material-ui/icons/AccountCircle';
// import { Redirect } from "react-router-dom";
// import { useScrollTrigger } from "@material-ui/core";
// import './Signup.css';

export default class SignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      phonenumber:null,
      password:null,
      loggedIn:false
    };
  }
  changeHandler = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };
  submitHandler = (e) => {
    e.preventDefault();
    console.log(this.state);
    // const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const url = "http://localhost:8080/covid/add/covid";
     fetch(url, {
      method: "POST",
      mode: "cors",
      cache: "no-cache",
      credentials: "same-origin",
      headers: {
        "Content-Type": "application/json",
      },
      redirect: "follow",
      referrerPolicy: "no-referrer",
      body: JSON.stringify(this.state),
    })
      .then((response) => response.text())
      .then((response) =>{
        console.log(response)

        if (this.state.password==="" || this.state.phonenumber==="")
        {

            alert("fill the blanks")
        }


        else if(response==="gotit")
        {
          console.log(this.state.password)
          this.setState({
            loggedIn:true
          })
        }


      })
      .catch(() =>
        console.log("Canâ€™t access " + url + " response. Blocked by browser")
      );
  };

  render() {
    if (this.state.loggedIn) {
      return <Redirect to="/login" />;
    }
    const form = {
      width: "100%",
      marginTop: "24px",
    };
    const submit = {
      margin: "24px 0px 16px",
    };
    const x={
        margin:"12px"
    }
    const { name, phonenumber, password } = this.state;
    return (
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <div>
        <div style={{ textAlign: "center",fontSize:"60px",paddingTop:"50px"}}>
          Contact Us
        </div>
          <form style={form} noValidate onSubmit={this.submitHandler}>
            <Grid container spacing={2}>
              <Grid item xs={12}>
              <TextField
        className={x}
        id="input-with-icon-textfield"
        label="Name"
        fullWidth="true"
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          ),
        }}
      />
              </Grid>
              <Grid item xs={12}>
              <TextField
        className={x}
        id="input-with-icon-textfield"
        label="Email"
        fullWidth="true"
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <EmailIcon/>
            </InputAdornment>
          ),
        }}
      />
              </Grid>
              <Grid item xs={12}>
              <TextField
          id="standard-textarea"
          label="Contact Us"
          placeholder="Min 50 words"
          multiline
          fullWidth="true"
          rows={8}
          defaultValue="Default Value"

        />
              </Grid>
            </Grid>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              color="white"
              //   disabled={!validateForm()}
              style={submit}
            >
              Sign Up
            </Button>
            <Grid container justify="flex-end">
              <Grid item>
                <Link href="login" variant="body2">
                  Already have an account? Sign in
                </Link>
              </Grid>
            </Grid>
          </form>
        </div>
        <Box mt={5}></Box>
      </Container>
    );
  }
}
